import React, { Component } from "react"
// import "../../assets/style/login/index"
import "../../assets/style/login/index.css"
export default class Login extends Component {
  render() {
    return (
      <div className="login">
        <div className="head">
          <div className="login_title"></div>
        </div>
        <div className="body"></div>
      </div>
    )
  }
}
